import React, { useEffect, useState } from "react";
import { motion, AnimatePresence } from "framer-motion";
import { Bar } from "react-chartjs-2";
import {
  GraduationCap,
  ClipboardList,
  MessageSquare,
  CalendarDays,
  Bell,
  BookOpen,
  LogOut,
  Moon,
  Sun,
  Mail,
  Phone,
  Layers,
  ChevronDown,
  ChevronUp,
} from "lucide-react";
import axios from "axios";

const API_BASE_URL = "http://127.0.0.1:8000/api";

const StudentDashboard: React.FC = () => {
  const [studentData, setStudentData] = useState<any>(null);
  const [darkMode, setDarkMode] = useState(false);
  const [aiFeedback, setAiFeedback] = useState("");
  const [profileOpen, setProfileOpen] = useState(false);
  const studentId = "gen002";

  useEffect(() => {
    fetchStudentData();
  }, []);

  const fetchStudentData = async () => {
    try {
      const response = await axios.get(`${API_BASE_URL}/students/${studentId}/`);
      setStudentData(response.data);
      generateAIFeedback(response.data);
    } catch (error) {
      console.error("Error fetching student data:", error);
    }
  };

  const generateAIFeedback = (data: any) => {
    const gpa = data?.gpa || 0;
    const attendance = 90;
    if (gpa > 3.5 && attendance > 85)
      setAiFeedback("ðŸŒŸ Excellent performance! Keep it up!");
    else if (gpa > 3.0)
      setAiFeedback("ðŸ‘ Great job! Stay consistent for even better results.");
    else if (gpa > 2.5)
      setAiFeedback("ðŸ“ˆ Youâ€™re improving â€” focus on weaker areas.");
    else setAiFeedback("ðŸš€ You can do much better! Focus on attendance & revision.");
  };

  const chartData = {
    labels: ["Week 1", "Week 2", "Week 3", "Week 4"],
    datasets: [
      {
        label: "Attendance %",
        data: [85, 90, 88, 92],
        backgroundColor: darkMode
          ? "rgba(147,197,253,0.7)"
          : "rgba(37,99,235,0.7)",
      },
    ],
  };

  return (
    <div
      className={`flex min-h-screen transition-all duration-500 ${
        darkMode ? "bg-gray-900 text-gray-100" : "bg-gray-100 text-gray-800"
      }`}
    >
      {/* Sidebar */}
      <div
        className={`w-72 ${
          darkMode ? "bg-gray-800" : "bg-white"
        } shadow-2xl flex flex-col justify-between`}
      >
        <div>
          {/* Header */}
          <div className="p-6 flex items-center justify-between border-b border-gray-200 dark:border-gray-700">
            <div className="flex items-center gap-2">
              <GraduationCap className="text-blue-600" size={26} />
              <h2 className="font-bold text-lg tracking-tight">
                Student Dashboard
              </h2>
            </div>
            <button
              onClick={() => setDarkMode(!darkMode)}
              className="p-2 rounded-full hover:bg-gray-200 dark:hover:bg-gray-700"
            >
              {darkMode ? <Sun size={18} /> : <Moon size={18} />}
            </button>
          </div>

          {/* Profile Summary */}
          {studentData && (
            <div
              className={`mx-4 mt-5 p-4 rounded-xl cursor-pointer transition-all ${
                darkMode ? "bg-gray-700" : "bg-gray-50"
              }`}
              onClick={() => setProfileOpen(!profileOpen)}
            >
              <div className="flex items-center justify-between">
                <div className="flex items-center gap-3">
                  <img
                    src={
                      studentData?.image
                        ? `${studentData.image}`
                        : "https://via.placeholder.com/80"
                    }
                    alt="Profile"
                    className="w-12 h-12 rounded-full object-cover border-2 border-blue-500"
                  />
                  <div>
                    <h3 className="font-semibold text-sm">
                      {studentData.name || "Student"}
                    </h3>
                    <p className="text-xs text-gray-400">
                      {studentData.student_id}
                    </p>
                  </div>
                </div>
                {profileOpen ? <ChevronUp size={18} /> : <ChevronDown size={18} />}
              </div>

              <AnimatePresence>
                {profileOpen && (
                  <motion.div
                    initial={{ opacity: 0, height: 0 }}
                    animate={{ opacity: 1, height: "auto" }}
                    exit={{ opacity: 0, height: 0 }}
                    className="mt-4 space-y-2 text-sm"
                  >
                    <div className="flex items-center gap-2 text-gray-400">
                      <Mail size={14} /> {studentData.email}
                    </div>
                    <div className="flex items-center gap-2 text-gray-400">
                      <Phone size={14} /> {studentData.phone}
                    </div>
                    <p className="text-gray-400">
                      Dept: <span className="text-gray-200">{studentData.department}</span>
                    </p>
                    <p className="text-gray-400">
                      Semester:{" "}
                      <span className="text-gray-200">{studentData.semester}</span>
                    </p>
                    <p className="text-gray-400">
                      CGPA:{" "}
                      <span className="text-gray-200 font-semibold">
                        {studentData.cgpa}
                      </span>
                    </p>
                  </motion.div>
                )}
              </AnimatePresence>
            </div>
          )}

          {/* Navigation Menu */}
          <nav className="p-6 flex flex-col gap-5 font-medium mt-4">
            <button className="flex items-center gap-3 hover:text-blue-500">
              <ClipboardList size={18} /> Results
            </button>
            <button className="flex items-center gap-3 hover:text-blue-500">
              <Layers size={18} /> Attendance
            </button>
            <button className="flex items-center gap-3 hover:text-blue-500">
              <MessageSquare size={18} /> Messaging
            </button>
            <button className="flex items-center gap-3 hover:text-blue-500">
              <CalendarDays size={18} /> Events
            </button>
            <button className="flex items-center gap-3 hover:text-blue-500">
              <Bell size={18} /> Announcements
            </button>
            <button className="flex items-center gap-3 hover:text-blue-500">
              <BookOpen size={18} /> Library
            </button>
          </nav>
        </div>

        {/* Logout Button */}
        <div className="p-5 border-t border-gray-200 dark:border-gray-700 flex items-center gap-2 hover:text-red-500 cursor-pointer">
          <LogOut size={18} /> Logout
        </div>
      </div>

      {/* Main Dashboard */}
      <div className="flex-1 p-8 overflow-y-auto">
        <motion.div
          className="mb-8"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
        >
          <h1 className="text-3xl font-bold text-blue-600 mb-2">
            Welcome, {studentData?.name || "Student"} ðŸ‘‹
          </h1>
          <p className="text-gray-500 dark:text-gray-400">
            {new Date().toLocaleDateString("en-GB", {
              weekday: "long",
              day: "numeric",
              month: "short",
              year: "numeric",
            })}
          </p>
        </motion.div>

        {/* Dashboard Cards */}
        <div className="grid md:grid-cols-2 gap-8">
          {/* Attendance Chart */}
          <motion.div
            className={`rounded-2xl shadow-md p-6 ${
              darkMode ? "bg-gray-800" : "bg-white"
            }`}
            initial={{ opacity: 0 }}
